import React, { Component } from "react";
import back from "../img/Back.svg";

export default class ArticleHeader extends Component {
  render() {
    return (
      <div className="header-container">
        <div className="max-width header-flex">
          <div>
            <button>
              <img alt="back" rc={back} />
            </button>
            <p
              onClick={() => this.onLogoClick()}
              className="logo-name logo-name--dark"
            >
              Back to Home
            </p>
          </div>
          <p className="article-chapter--dark">
            Youtube 2.0
            <span>Modern Platform to watch content</span>
          </p>
        </div>
      </div>
    );
  }
}
